import { NavLink } from "react-router-dom";
import "../styles/header.css"

const links = [
  {
    title: "Medinova",
    link: "/"
  },

  {
    title: "Login",
    link: "/login"
  },

  {
    title: "Signup",
    link: "/signup"
  },


 
];
export const Nav = () => {
  return(
    //map through the link ad display it in header
     <div>
       {links.map(({title, link}, index) => {
             return <NavLink key={index} to={link} style={{color: 'white', textDecoration: 'none', margin: 'auto'}}>{title}</NavLink>
       })}
     </div>

  );
};
